import React from 'react'
import styles from '../css/Swiper.css';

function TrendingDestinationInner() {
    var swiper = new Swiper('.swiper-container', {
        navigation: {
          nextEl: '.swiper-button-next',
          prevEl: '.swiper-button-prev',
        },
      });
  return (
    <div className='row'>
         <div style={styles['swiper-container']}>
         <div style={styles['swiper-wrapper']}>
         <div style={styles['swiper-slide']}>
            <div className="row">
            <div class="col-md-3">
                            <div style={styles['card']}>
                                <div style={styles["card-img"]}><img src="https://img.gaadicdn.com/images/carexteriorimages/upcoming/360x240/Jeep/Jeep-Renegade/047.jpg"/></div>
                                <div style={styles["card-body"]}>
                                   <h5>Renault KWID</h5>
                                   <h4 class="pt-1 pb-2">Rs. 5.44-6.77 Lac</h4>

                                   <button type= "button" className="btn btn-outline-danger btn-block btn-sm">Lets Judge it.</button>
                                </div>
                            </div>
                        </div>
            </div>
         </div>
         </div>
         </div>
    </div>
  )
}

export default TrendingDestinationInner
